import React from 'react';
import Log from './componentsel/Log';
import Logcr from './componentsel/Logcr';
import './Login.css';

export default class Login extends React.Component {
  state = {
    login: [],
  };

  Ren = (text, ps) => {
    this.setState(() => {
      const login = {
        email: text,
        password: ps,
        id: newId++,
      };
    });
  };

  render() {
    const { login } = this.state;
    return (
      <div className='login'>
        <Log Ren={this.Ren} />
        {login.map((item) => {
          return <Logcr {...item} />;
        })}
      </div>
    );
  }
}
